0\u0431\u0435\u0440\u0442\u0430 \u0423\u044d\u043b\u043b\u0441\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2\" title=\"\u0412\u043e\u0439\u043d\u0430 \u043c\u0438\u0440\u043e\u0432\">\u0412\u043e\u0439\u043d\u0430 \u043c\u0438\u0440\u043e\u0432<\/a>\u00bb, \u0441\u0442\u0438\u043b\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u043f\u043e\u0434 \u043f\u0440\u044f\u043c\u043e\u0439 \u0440\u0435\u043f\u043e\u0440\u0442\u0430\u0436 \u0441 \u043c\u0435\u0441\u0442\u0430 \u0441\u043e\u0431\u044b\u0442\u0438\u0439. \u041c\u043d\u043e\u0433\u0438\u0435 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0446\u044b \u043f\u043e\u0432\u0435\u0440\u0438\u043b\u0438 \u0432 \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u0441\u043e\u0431\u044b\u0442\u0438\u0439, \u0447\u0442\u043e \u0432\u044b\u0437\u0432\u0430\u043b\u043e \u043d\u0435\u0432\u0438\u0434\u0430\u043d\u043d\u0443\u044e \u043f\u0430\u043d\u0438\u043a\u0443. \u0420\u0435\u0436\u0438\u0441\u0441\u0451\u0440\u043e\u043c \u0440\u0430\u0434\u0438\u043e\u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0438 \u0431\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D1%81%D0%BE%D0%BD_%D0%A3%D1%8D%D0%BB%D0%BB%D1%81\" class=\"mw-redirect\" title=\"\u041e\u0440\u0441\u043e\u043d \u0423\u044d\u043b\u043b\u0441\">\u041e\u0440\u0441\u043e\u043d \u0423\u044d\u043b\u043b\u0441<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D0%9E%D1%82%D0%B5%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u04