u044f\">\u041d\u043e\u0432\u0430\u044f \u0417\u0435\u043c\u043b\u044f<\/a>. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%80%D1%83%D1%89%D1%91%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%B8%D1%82%D0%B0_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0425\u0440\u0443\u0449\u0451\u0432, \u041d\u0438\u043a\u0438\u0442\u0430 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041d\u0438\u043a\u0438\u0442\u0430 \u0425\u0440\u0443\u0449\u0451\u0432<\/a> \u043f\u043e\u0448\u0443\u0442\u0438\u043b, \u0447\u0442\u043e \u043f\u0435\u0440\u0432\u043e\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u043b\u043e\u0441\u044c \u0432\u0437\u043e\u0440\u0432\u0430\u0442\u044c 100-\u043c\u0435\u0433\u0430\u0442\u043e\u043d\u043d\u0443\u044e \u0431\u043e\u043c\u0431\u0443, \u043d\u043e \u0437\u0430\u0440\u044f\u0434 \u0443\u043c\u0435\u043d\u044c\u0448\u0438\u043b\u0438, \u0447\u0442\u043e\u0431\u044b \u043d\u0435 \u043f\u043e\u0431\u0438\u0442\u044c \u0432\u0441\u0435 \u0441\u0442\u0451\u043a\u043b\u0430 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967_%D0%B3%D0%BE%D0%B4\" title=\"1967 \u0433\u043e\u0434\">1967<\/a>&#160;\u2014 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%81%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D1%80%D0%BE%D1%81%D1%82%D1%80%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u043e\">\u043a\u043e\u0441\u043c\u043e\u0441\u0435<\/a> \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0430 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0441\u0442\u044b\u043a\u043e\u0432\u043a\u0430 \u043a\u043e\u0440\u0430\u0431\u043b\u0435\u0439, \u044d\u0442\u043e \u0431\u044b\u043b\u0438 \u0430\u04